import React, { useState } from 'react'
import { GridCards } from './components/Card/GridCards'
import { InputSearch } from './components/Card/InputSearch'

export const FlickrSearchApp = () => {

    const [keyword, setKeyword] = useState('')

    return (
        <div className="container mx-auto">
            <h2 className="text-black-500 text-3xl mt-5 font-rale font-black">Gif Expert App</h2>
            <hr />

            <InputSearch setKeyword={ setKeyword } ></InputSearch>
            <GridCards keyword={ keyword }/>
        </div>
    )
}
